import * as CommonStyles from '../../styles/common-styles';
import React from 'react';
import ResponsiveTextField from '../../common-comps/ResponsiveTextField';
import ResponsiveText from '../../common-comps/ResponsiveText';

const TITLE_SIZE = 36;
const TEXT_FIELD_SIZE = 28;
const TEXT_FIELD_WIDTH = '32%';

export default class AccountInfo extends React.Component<any, any> {
    constructor(props: any) {
        super(props);
    }

    containerStyle = () => ({
        width: '100%'
    });

    textFieldContainer = () => ({
        ...CommonStyles.FlexCSpace,
        width: '100%'
    });

    render = () => {
        return (
            <div style={this.containerStyle()}>
                <ResponsiveText size={TITLE_SIZE} padding="2.5% 0 1% 0">
                    Personal Information
                </ResponsiveText>
                <div style={this.textFieldContainer()}>
                    <ResponsiveTextField
                        placeholder="First Name"
                        onChange={() => console.log('hi')}
                        size={TEXT_FIELD_SIZE}
                        width={TEXT_FIELD_WIDTH}
                    ></ResponsiveTextField>
                    <ResponsiveTextField
                        placeholder="Last Name"
                        onChange={() => console.log('hi')}
                        size={TEXT_FIELD_SIZE}
                        width={TEXT_FIELD_WIDTH}
                    ></ResponsiveTextField>
                    <ResponsiveTextField
                        placeholder="Grade Level"
                        onChange={() => console.log('hi')}
                        size={TEXT_FIELD_SIZE}
                        width={TEXT_FIELD_WIDTH}
                    ></ResponsiveTextField>
                </div>
            </div>
        );
    };
}
